import './style.css';
import { useState } from 'react';
import Description from './Description.js';
import Demo from './Demo.js';

function App() {
  const [values, setValues] = useState({
    pages: [true, false],
    tabs: [true, false, false, false]
  })

  return (
    <div className="App">
      <Description
        values={values}
        setValues={setValues}
      />
      <Demo
        values={values}
        setValues={setValues}
      />
    </div>
  );
}

export default App;
